<template>
  <div class="loading-container">
    <div class="logo-container">
       <svg width="360" height="360"> 
        <circle
          cx="180"
          cy="180"
          r="175"
          stroke="#000000"
          stroke-width="10"
          fill="none"></circle>
        <circle
          cx="180"
          cy="180"
          r="175" 
          stroke="#816AE6"
          stroke-width="10"
          fill="none"
          :stroke-dasharray="circumference"
          :stroke-dashoffset="circumference - (circumference * progress) / 100"
          style="transition: stroke-dashoffset 0.1s;"></circle> 
      </svg>
      <svg class="logo" width="341" height="341" viewBox="0 0 341 341" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
        <rect width="341" height="341" fill="url(#pattern0_491_31)"/>
        <defs>
        <pattern id="pattern0_491_31" patternContentUnits="objectBoundingBox" width="1" height="1">
        <use xlink:href="#image0_491_31" transform="scale(0.00293255)"/>
        </pattern>
        <image id="image0_491_31" width="341" height="341" xlink:href="data:image/png;base64,"/>
        </defs>
      </svg>
    </div>
  </div>
</template>

<script>
export default {
  data() {
    return {
      progress: 0,
      interval: null,
      radius: 180, 
      circumference: 0,
    };
  },
  mounted() {
    this.circumference = 2 * Math.PI * this.radius;
    this.startLoading();
  },
  beforeDestroy() {
    clearInterval(this.interval);
  },
  methods: {
    getActiveAccount() {
      const accounts = [
        {
          AccountName: 'Nikita',
          AccountId: 1,
          Balance: 100,
          TelegramId: '123456789',
          WalletName: ['a', 'b', 'c', 'd'],
          isActive: false,
        },
        {
          AccountName: 'Kostya',
          AccountId: 2,
          Balance: 200,
          TelegramId: '987654321',
          WalletName: ['a', 'b'],
          isActive:false ,
        },
        {
          AccountName: 'Ilya',
          AccountId: 3,
          Balance: 300,
          TelegramId: '1122334455',
          WalletName: ['c', 'd'],
          isActive: false,
        },
      ];
      return accounts.find(account => account.isActive);
    },
    startLoading() {
      this.interval = setInterval(() => {
        if (this.progress < 100) {
          this.progress += 2; //    2%  100 
        } else {
          clearInterval(this.interval);
          const activeAccount = this.getActiveAccount();
          if (activeAccount) {
            this.$router.push({ path: '/main', query: { AccountName: activeAccount.AccountName,
                                                        AccountId: activeAccount.AccountId,
                                                        Balance: activeAccount.Balance,
                                                        TelegramId: activeAccount.TelegramId,
                                                        WalletName: activeAccount.WalletName.join(','),} });
          } else {
            this.$router.push({ path: '/reglogwalletpage', query: { hello: "hello"}});
          }
        }
      }, 50);
    },
  },
};
</script>

